import fs from "node:fs";
import path from "node:path";

const BASE64_GLB = ``;

const outPath = path.join(process.cwd(), "public/assets/main/main.glb");
fs.mkdirSync(path.dirname(outPath), { recursive: true });
const buf = Buffer.from(BASE64_GLB, "base64");
fs.writeFileSync(outPath, buf);
console.log(`WROTE main.glb bytes=${buf.length}`);
